import React, { Component } from 'react'

export default class EligeReacion extends Component {
    render() {
        return (
            <div class="modal fade bd-example-modal-sm" tabindex="-1" role="dialog" aria-labelledby="mySmallModalLabel" aria-hidden="true">
                <div class="modal-dialog modal-sm rounded-pill">
                    <div class="modal-content rounded-pill">
                        <div class="btn-group rounded-pill" role="group" aria-label="Basic example">
                            <span>
                                <img src={'./images/megusta.gif'} width="45" height="45" className="rounded-circle m-2 float-left border" alt="" />
                            </span>

                            
                        </div>

                    </div>
                </div>
            </div>
        )
    }
}
